import React from "react";
import PostThumb from "../components/PostThumb.js"
import rawData from "../postData.json"

const Root = () => {

const [postData, setPostData] = React.useState(rawData.results);

  return (
    <div>
        <section className="title">
          <h1>Tiago Almeida</h1>
          <h2>Copywriter</h2>
        </section>

        <section className="articles">
        {Object.entries(postData).map(([slug, { title }]) => (
        <Link to={`/posts/${slug}`} className="article" key={slug}>
          <h3>{title}</h3>
        </Link>
        ))}
        </section>
    </div>
  );
};
  
export default Root;
